import { useEffect, useState } from "react"
import Request from "../Request"
import { useAuth0 } from "@auth0/auth0-react"
import Rocket from "../../svg/rocket.svg"
import PricingCard from "./PricingCard"
import Footer from "../Footer"

const Settings = ({ subscription, setSubscribed, userID }) => {
	const { user } = useAuth0()
	const { picture } = user
	const [wordsUsed, setWordsUsed] = useState(null)

	useEffect(() => {
		const meRequest = new Request("users/wordcount/")
		meRequest
			.then((res) => {
				setWordsUsed(res.data.wordcount)
			})
			.catch((err) => {
				console.log(err)
			})
	}, [])

	const [formData, setFormData] = useState({
		email: "",
	})

	const handleCancelSubscription = () => {
		const parameters = {
			method: "POST",
		}

		const cancelSubscriptionRequest = new Request(
			"stripe/cancel-subscription/",
			parameters
		)

		cancelSubscriptionRequest
			.then((res) => {
				console.log(res.data)
				setSubscribed(false)
			})
			.catch((err) => {
				console.log(err)
			})
	}

	const handleSubscription = (subscription_type) => {
		const commandsRequest = new Request("stripe/create-checkout-session/", {
			method: "POST",
			data: {
				subscription_type: subscription_type,
			},
		})

		commandsRequest
			.then((response) => {
				window.location.href = response.data.url
			})
			.catch((err) => {
				console.log(err)
			})
	}

	const submitForm = () => {
		const parameters = {
			data: formData,
			method: "POST",
		}

		const profileRequest = new Request("users/" + { userID } + "/", parameters)
	}

	const handleCheckout = (e) => {
		const commandsRequest = new Request("stripe/create-checkout-session/", {
			method: "POST",
		})

		commandsRequest
			.then((response) => {
				window.location.href = response.data.url
			})
			.catch((err) => {
				console.log(err)
			})
	}

	return (
		// Profile Settings
		<>
			<div className='flex flex-col w-4/5 items-center mt-4 overflow-y-scroll'>
				<div className='bg-white w-[85%] flex flex-row my-5 h-fit rounded-2xl p-5 pl-10 pr-10'>
					<div className='flex-1 flex-col'>
						<div className='flex flex-col items-left'>
							<p className='font-semibold text-3xl'>Profile</p>
						</div>
						<div className='w-[95%]'>
							<div className='flex flex-row mt-5 space-x-5 w-full'>
								<div className='flex flex-col w-1/2'>
									<p className='font-semibold'>Email</p>
									<input
										type='text'
										className='border-[1px] border-[#475467]/30 rounded-lg p-3 mt-2'
										value={user.email}
										onChange={(e) =>
											setFormData({
												...formData,
												email: e.target.value,
											})
										}
										disabled={true}
									/>
								</div>
								<div className='flex flex-col w-1/2'>
									<p className='font-semibold'>Full Name</p>
									<input
										type='text'
										className='border-[1px] border-[#475467]/30 rounded-lg p-3 mt-2'
										value={user.name}
										onChange={(e) =>
											setFormData({
												...formData,
												name: e.target.value,
											})
										}
										disabled={true}
									/>
								</div>
							</div>
							{/* <div
							className='bg-[#7D55D6] rounded-md text-center px-2 py-4 mt-5 w-[20%] ml-auto hover:cursor-pointer'
							onClick={submitForm}
						>
							<p className='font-normal text-white'>Save Changes</p>
						</div> */}
						</div>
					</div>
					<div className='flex flex-col justify-between mt-1'>
						<img src={picture} alt='PFP' className='rounded-full h-16 w-16' />
					</div>
				</div>

				{/* Subscription Box */}
				{subscription["subscribed"] && (
					<div className='bg-white w-4/5 my-5 h-fit rounded-2xl py-5 px-10'>
						<div className='flex flex-row items-center'>
							<p className='font-medium text-3xl'>Subscription Details</p>

							<div className='rounded-2xl bg-[#7D55D6]/10 p-2 ml-5'>
								<p className='font-semibold text-sm text-[#7D55D6]'>
									ACTIVE SUBSCRIPTION
								</p>
							</div>
						</div>

						{/* Plan Information */}
						<div className='flex flex-row w-full mt-5'>
							<div className='flex flex-col w-1/2 mt-5 mb-5 justify-between items'>
								<div className='flex flex-col space-y-5 justify-between'>
									<div className='flex flex-row justify-between'>
										<p className='text-[#475467] font-normal'>Plan</p>
										<p className='text-[#101828] font-semibold'>
											{subscription["subscription_type"] === "lifetime"
												? "Lifetime (Early Supporter)"
												: "Monthly"}
										</p>
									</div>
									{subscription["subscription_type"] === "monthly" && (
										<div className='flex flex-row justify-between'>
											<p className='text-[#475467] font-normal'>
												Subscribed Until
											</p>
											<p className='text-[#101828] font-semibold'>
												{subscription["subscribed_until"]}
											</p>
										</div>
									)}
									<div className='flex flex-row justify-between'>
										<p className='text-[#475467] font-normal'>
											Words Generated
										</p>
										<p className='text-[#101828] font-semibold'>{wordsUsed}</p>
									</div>

									<div className='flex flex-row justify-between'>
										<p className='text-[#475467] font-normal'>Word Limit</p>
										<p className='text-[#101828] font-semibold'>
											{subscription["subscription_type"] === "monthly"
												? "100,000"
												: "Unlimited"}
										</p>
									</div>
								</div>
								<div className='flex flex-col'>
									{subscription["subscription_type"] === "monthly" && (
										<div
											className='bg-red-500 rounded-md text-center px-2 py-4 mt-5 w-full ml-auto mr-auto hover:cursor-pointer'
											onClick={() => {
												// mailto with subject, "[ASSISTANCE] Cancel subscription", and body "Please cancel my subscription."
												window.open(
													"mailto:founders@delilah.ai?subject=[ASSISTANCE] Cancel subscription&body=Please cancel my subscription."
												)
											}}
										>
											<p className='font-normal text-white'>
												Cancel your subscription
											</p>
										</div>
									)}
									<div
										className='bg-[#7D55D6] rounded-md text-center px-2 py-4 mt-5 w-full ml-auto mr-auto hover:cursor-pointer'
										onClick={() => {
											window.open("mailto:founders@delilah.ai")
										}}
									>
										<p className='font-normal text-white'>
											Thanks for supporting Delilah! Click here to email us.
										</p>
									</div>
								</div>
							</div>

							{/* Divider */}
							<div className='w-[3px] bg-[#7D55D6]/25 ml-10 mr-10'></div>

							<div className='w-1/2 flex justify-center items-center'>
								<img src={Rocket} alt='Rocket' className='h-1/2 h-fit' />
							</div>
						</div>
					</div>
				)}

				{!subscription["subscribed"] && (
					<div className='my-5 w-[90%] h-fit rounded-2xl py-5 px-10 flex flex-col'>
